import React from 'react';
import '../App.css';
import{
  Route,
  withRouter
} from "react-router-dom";
import AllNotes from '../components/AllNotes';
import FullNote from '../components/FullNote';
import SearchBarForm from '../components/SearchBarForm';
// import CreateNoteForm from '../components/CreateNoteForm';
// import EditNoteForm from '../components/EditNoteForm';

class UserNotePage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div className="Note-container" style={ {border: "1px solid blue", padding: "1rem"}}>
        <SearchBarForm  />
        <AllNotes userSignedIn={this.props.userSignedIn} currentUser={this.props.currentUser} userNotes={this.props.currentUser.notes} currentNote={this.state.currentNote}/>
        <FullNote />
      </div>
    )
  }
}
export default withRouter(UserNotePage);
